import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Utilisation de BrowserRouter dans React Router v6
import { AuthProvider } from './context/authContext';
import Login from './components/login';
import Register from './components/signup';
import ForgotPassword from './components/forgotPassword'; // Correct import

function App() {
  return (
    <div className='app'>
      <AuthProvider>
        <Router> {/* Utilisation de Router au lieu de BrowserRouter */}
          <Routes> {/* Utilisation de Routes au lieu de Switch */}
            <Route path='/login' element={<Login />} />
            <Route path='/signup' element={<Register />} />
            <Route path='/forgot-password' element={<ForgotPassword />} /> {/* Correct path */}
          </Routes>
        </Router>
      </AuthProvider>
    </div>
  );
}

export default App;
